CREATE TABLE `languages` (
  `language` int(11) NOT NULL AUTO_INCREMENT COMMENT 'Unique language ID',
  `language_iso_639_3` varchar(3) DEFAULT NULL COMMENT 'The three-letter 639-3 identifier',
  `language_iso_639_2_bac` varchar(3) DEFAULT NULL COMMENT 'Equivalent 639-2 identifier of the bibliographic applications code set, if there is one',
  `language_iso_639_2_tac` varchar(3) DEFAULT NULL COMMENT 'Equivalent 639-2 identifier of the terminology applications code set, if there is one',
  `language_iso_639_1` varchar(2) DEFAULT NULL COMMENT 'Equivalent 639-1 identifier, if there is one',
  `scope` tinyint(1) NOT NULL DEFAULT '0' COMMENT '0 = Individual, 1 = Macrolanguage, 2 = Special',
  `type` tinyint(1) NOT NULL DEFAULT '4' COMMENT '0 = Ancient, 1 = Constructed, 2 = Extinct, 3 = Historical, 4 = Living, 5 = Special',
  `language_name` tinytext NOT NULL COMMENT 'Reference language name ',
  `comment` tinytext COMMENT 'Comment relating to one or more of the columns',
  PRIMARY KEY (`language`),
  UNIQUE KEY `language_iso_639_3` (`language_iso_639_3`),
  UNIQUE KEY `language_iso_639_2_bac` (`language_iso_639_2_bac`),
  UNIQUE KEY `language_iso_639_2_tac` (`language_iso_639_2_tac`),
  UNIQUE KEY `language_iso_639_1` (`language_iso_639_1`)
) ENGINE=MyISAM AUTO_INCREMENT=7843 DEFAULT CHARSET=utf8;
